import React from "react";
import "../App";
import { Link } from "react-router-dom";
const Navbar = () => {
  return (
    <div className="navbar">
      {/* <a href="/">BookShelf</a>

      <a href="/favourites">Favourites</a> */}
      <Link to="/">
        <h1>BookShelf</h1>
      </Link>
      <Link to="/dashboard">
        <h1>Dashboard</h1>
      </Link>
      <Link to="/login">
        <h1>Login</h1>
      </Link>
    </div>
  );
};

export default Navbar;
